Prior to the 2008 amalgamation, the Goondiwindi Region existed as three distinct local government areas:

the Town of Goondiwindi;
the Shire of Waggamba;
and the Shire of Inglewood.Inglewood and Waggamba began as two of Queensland's 74 divisions created under the Divisional Boards Act 1879 on 11 November 1879.

